def lists_with_product_equal_n(lst):
    def product(lst):
        p = 1
        for num in lst:
            p *= num
        return p

    sublists = []
    n = len(lst)
    for i in range(n):
        for j in range(i + 1, n + 1):
            if product(lst[i:j]) == 46:
                sublists.append(lst[i:j])
    return sublists
